Camera Photo Translator enables to recognize and translate texts and objects from any image. It has become easier and quicker to translate – the app scans the text and instantly shows the translation.

Due to Camera Photo Translator one can easily scan texts from images and translate them to any language:
• Paper documents;
• Road signs in airports and at stations;
• Menu card in restaurants, pubs and cafes;
• Specifications and operation manuals;
• Product contents on packages;
• Recipes from recipe books;
• Notes;
• Articles in magazines and newspapers;
• Fragments of books;
• and much more…

With Camera Photo Translator you’ll bridge language gaps and get acquainted with a brand new way of translation in one click.

HOW DOES IT WORK IN A TEXT MODE?
1)	Take photo of a printed text;
2)	Observe the translation made on a previously chosen language;
3)	Listen to the pronunciation of translation;
4)	Copy the translation and share it with friends via any messengers.

HOW DOES IT WORK IN AN OBJECT MODE?
1)	Take photo of an object;
2)	Get the name of the object in original language and its translation into a target language;
3)	Listen to the pronunciation and share it with friends.

The app will also save the photo and translation for you, so that you can any time return to this moment from your trip.

Note: the free of charge version may have limited number of voice translations per day and these restrictions can be changed.

